import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { UserSetupProvider } from './context/UserSetupContext';
import './index.css';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <UserSetupProvider>
      <App />
    </UserSetupProvider>
  </React.StrictMode>
);
